import React from "react";
import Navbar from "../components/navbar";
import Banner from "../components/Banner";
import Categories from "../components/Categories";
const Home = () => {
  return (
    <>
      <Navbar />
      <Banner />
      <Categories />
    </>
  );
};

export default Home;
